INSERT INTO `product` (`product_id`, `product_name`, `product_type`, `description`, `price`, `discount`) VALUES
(0, 'Hóvirág', 'virágmag', 'Télálló\r\nNövekedési magasság:\r\n 15 cm - 20 cm\r\nCserépbe ültethető.', 50, 0),
(1, 'Körömvirág', 'virágmag', 'Gyógy-és dísznövény. Laza,középkötött,közepes tápanyagtartalmú talajt igényel. Vetés: áprilisban végleges helyére. A vetést ne takarjuk, mivel fényre csírázik. Térállás: 20x15 cm. Felhasználás: féltelt virágai a sárga szín különböző árnyalataiban folyamatosan nyílnak. Kiválóan alkalmas virágágyak, sírok beültetésére. A magasabb fajták vágottvirágként is jól hasznosíthatók. Szedjük le az elnyílott virágokat, így hosszabban virágzik.', 50, 0),
(2, 'Nefelejcs sotetkek', 'virágmag', 'Kék virágai miatt kedvelt, tavasszal nyíló alacsony 10-18 cm-es kétnyári növény. Rövid elágazó száron hozza 3-8 mm-es virágait. A vetést ne takarjuk, a csírázáshoz fényt igényel. Kelésig erősen árnyékoljuk, és tartsuk állandóan nyirkosan. Végleges helyére szeptemberben vagy márciusban ültethető. Télen ajánlott mérsékelten takarni. Napos-félárnyékos helyre, jó kerti talajba ültessük. Felhasználása igen sokoldalú. Május elejére elvirágzik, helyére egynyári virágokat ültessünk. Térállás: 15x15 cm. 0', 55, 0),
(3, 'Őszirózsa', 'virágmag', 'Változatokban és fajtákban a leggazdagabb egynyári virág faj. Napos helyen, középkötött vagy lazább, tápanyagokban gazdag talajban fejlődik legszebben. Veszedelmes betegsége a hervadásos vész, ezért lehetőleg olyan helyre ültessük, ahol több éve nem volt őszirózsa. Vetés: március elején melegágyba vagy fűthető fólia alá vetjük. Április elején már állandó helyére is vethető, de így később virágzik. Térállás: Felhasználás: a fajtatípusok alkalmazási lehetőségei sokfélék, hazánkban azonban az őszirózsa elsősorban, mint augusztus szeptemberi vágott virág jelentős.', 50, 0),
(4, 'Margaréta', 'virágmag', 'Közismert, sokoldalúan felhasználható évelő növény. Közép-magas 70-80 cm-es évelő dísznövény. Levelei finoman osztottak, szürkés zöldek. Hosszú száron június-júliusban nyílnak 5-7 cm-es egyszerű fészkes virágai fehér, rózsaszín, piros színekben. A vetést ne takarjuk be, a csírázáshoz fényt igényel. Végleges helyére szeptemberben ültethető. Télire gyenge takarás ajánlatos. Vályogos, üde, enyhén savanyú talajban, napos helyen fejlődik a legszebben. Mutatós vágott virág és szép kerti dísz, évelőágyi kiültetésre alkalmas.', 50, 1),
(5, 'Répa', 'vetőmag', 'Sárgarépa mag, koratavasszal ültetendő.', 60, 5),
(6, 'Echino kaktusz', 'kaktusz', 'Mexikóból származik, óriás sünkaktusznak is nevezik, átmérője elérheti a 70 cm-t is akár, 30 bordával.', 2000, 3),
(7, 'Cseresznye', 'fa', 'Regina cseresznyefa csemete, fagyok után kiültetendő, termése sötét piros.', 600, 3);

